import 'package:decimal/decimal.dart';

class CoinGraph {
  CoinGraph({
    String? message,
    bool? hasError,
    dynamic error,
    PriceData? data,
  }) {
    _message = message;
    _hasError = hasError;
    _error = error;
    _data = data;
  }

  CoinGraph.fromJson(dynamic json, String coin) {
    _message = json['message'];
    _hasError = json['hasError'];
    _error = json['error'];
    _data = json['data'] != null
        ? PriceData.fromJson(json['data'][coin.toString()])
        : null;
  }

  String? _message;
  bool? _hasError;
  dynamic _error;
  PriceData? _data;

  String? get message => _message;

  bool? get hasError => _hasError;

  dynamic get error => _error;

  PriceData? get data => _data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['message'] = _message;
    map['hasError'] = _hasError;
    map['error'] = _error;
    if (_data != null) {
      map['data'] = _data?.toJson();
    }
    return map;
  }
}

class PriceData {
  PriceData({
    int? updatedAt,
    Prices? prices,
    PriceChange24HPercent? priceChange24HPercent,
    PriceChange7DPercent? priceChange7DPercent,
    PriceChange30DPercent? priceChange30DPercent,
    HistoryPrices? historyPrices,
  }) {
    _updatedAt = updatedAt;
    _prices = prices;
    _priceChange24HPercent = priceChange24HPercent;
    _priceChange7DPercent = priceChange7DPercent;
    _priceChange30DPercent = priceChange30DPercent;
    _historyPrices = historyPrices;
  }

  PriceData.fromJson(dynamic json) {
    _updatedAt = json?['updatedAt'] ??= 0;
    _prices = json?['prices'] != null ? Prices.fromJson(json['prices']) : null;
    _priceChange24HPercent = json?['priceChange24HPercent'] != null
        ? PriceChange24HPercent.fromJson(json['priceChange24HPercent'])
        : null;
    _priceChange7DPercent = json?['priceChange7DPercent'] != null
        ? PriceChange7DPercent.fromJson(json['priceChange7DPercent'])
        : null;
    _priceChange30DPercent = json?['priceChange30DPercent'] != null
        ? PriceChange30DPercent.fromJson(json['priceChange30DPercent'])
        : null;
    _historyPrices = json?['historyPrices'] != null
        ? HistoryPrices.fromJson(json['historyPrices'])
        : null;
  }

  int? _updatedAt;
  Prices? _prices;
  PriceChange24HPercent? _priceChange24HPercent;
  PriceChange7DPercent? _priceChange7DPercent;
  PriceChange30DPercent? _priceChange30DPercent;
  HistoryPrices? _historyPrices;

  int? get updatedAt => _updatedAt;

  Prices? get prices => _prices;

  PriceChange24HPercent? get priceChange24HPercent => _priceChange24HPercent;

  PriceChange7DPercent? get priceChange7DPercent => _priceChange7DPercent;

  PriceChange30DPercent? get priceChange30DPercent => _priceChange30DPercent;

  HistoryPrices? get historyPrices => _historyPrices;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['updatedAt'] = _updatedAt;
    if (_prices != null) {
      map['prices'] = _prices?.toJson();
    }
    if (_priceChange24HPercent != null) {
      map['priceChange24HPercent'] = _priceChange24HPercent?.toJson();
    }
    if (_priceChange7DPercent != null) {
      map['priceChange7DPercent'] = _priceChange7DPercent?.toJson();
    }
    if (_priceChange30DPercent != null) {
      map['priceChange30DPercent'] = _priceChange30DPercent?.toJson();
    }
    if (_historyPrices != null) {
      map['historyPrices'] = _historyPrices?.toJson();
    }
    return map;
  }
}

